function buildPolygon(coordinates)
{
  var poly = new polygon();
  poly.tris = arraytoPoints(coordinates);
  objArray.push(poly);
}

function arraytoPoints(array)
{
  //Add z-axis if missing
  for (var i = 0; i < array.length; i += 1) { 
      if (array[i].length < 3) { array[i].push(0); } 
  }

  return array;
}


//Visvalingam-Whyatt
function vwTree() {

  var binaryTree = [];
  var linkedList = [];

  binaryTree.initialize = function() {

    for (var i = 0; i < objArray.length; i += 1) {

      for (var ii = 1; ii < objArray[i].tris.length - 1; ii += 1) {

        var tri = [ objArray[i].tris[ii - 1], objArray[i].tris[ii], objArray[i].tris[ii + 1] ];

        binaryTree.add(i, tri);
        linkedList.add(i, tri);
      }

      linkedList[i][0][0][2] = linkedList[i][binaryTree[i].length - 1][2][2] = Infinity;

      for (var ij = 0; ij < linkedList[i].length; ij += 1) {

        var tri = linkedList[i][ij];
        tri.previous = linkedList[i][ij - 1];
        tri.next = linkedList[i][ij + 1];
      }

      //linkedList.print(i);
    }
  }

  binaryTree.filter = function() {

    for (var index = 0; index < linkedList.length; index += 1) {

      //console.log("initial");
      //binaryTree.print(index);

      var scanline = 0, counter = 0, current;

      while (current = binaryTree.scalp(index)) {

        //console.log("scalped");
        //binaryTree.specificPrint(current);
        //binaryTree.print(index);

        //if (counter++ > 30) {return; }

        var previous = current.previous;
        var next = current.next;

        ( scanline < current[1][2] ) ? scanline = current[1][2] : current[1][2] = scanline;

        if (previous) {

          previous[2] = current[2];

          //console.log("previous: " + previous[0] + " : " + previous[1] + " : " + previous[2] + " : " + previous[3]);
          //console.log("previous entry: " + binaryTree[index][previous[3]][0] + " : " + binaryTree[index][previous[3]][1] + " : " + binaryTree[index][previous[3]][2] + " : " + binaryTree[index][previous[3]][3]);
          
          previous[1][2] = binaryTree.calcArea(previous);
          binaryTree.remove(index, previous[3]);

          //console.log("removed");
          //binaryTree.print(index);

          binaryTree.add(index, previous);

          //console.log("added");
          //binaryTree.print(index);
        }

        //Problem lies here maybe
        if (next) {

          next[0] = current[0];

          //console.log("next: " + next[0] + " : " + next[1] + " : " + next[2] + " : " + next[3]);
          //binaryTree.specificPrint(binaryTree[index][next[3]]);

          next[1][2] = binaryTree.calcArea(next);

          binaryTree.remove(index, next[3]);
          binaryTree.add(index, next);
        
          //binaryTree.print(index);

        }
      }
    }
  }

  binaryTree.execute = function(threshold) {

    for (var i = 0; i < linkedList.length; i += 1 ) {

      var result = [];
      //console.log(linkedList[i]);

      result.push(linkedList[i][0][0]);

      for (var ii = 0; ii < linkedList[i].length; ii += 1) {

        if (linkedList[i][ii][1][2] > threshold) { 
          result.push( [ linkedList[i][ii][1][0], linkedList[i][ii][1][1] ] );
        }
      }

      result.push(linkedList[i][linkedList[i].length-1][2]);

      //console.log(result);
      objArray[i].tris = [];
      objArray[i].tris = result;

      //console.log(objArray[i].translate);

    }
  }


  binaryTree.add = function(index, entry) {

    if (!binaryTree[index]) { binaryTree[index] = []; linkedList[index] = []; }

    binaryTree[index].push(entry);

    binaryTree[index][binaryTree[index].length-1][1][2] = binaryTree.calcArea(entry);
    binaryTree[index][binaryTree[index].length-1][3] = binaryTree[index].length-1;

    heapify_up(index, binaryTree[index].length-1);
  }


  linkedList.add = function(index, entry) { 

    if (!linkedList[index]) { linkedList[index] = []; }

    linkedList[index].push(entry); 
  }


  binaryTree.remove = function(i, ii) {

    if (binaryTree.length <= 0) return;

    var tri = binaryTree[i][ii];
    var lastTri = binaryTree[i].pop();

    if (ii != lastTri[3]) {
      lastTri[3] = ii;
      binaryTree[i][ii] = lastTri;
    }
    
    ( lastTri[1][2] < tri[1][2] ) ? heapify_up(i, ii) : heapify_down(i, ii);

    return tri;
  }


  binaryTree.scalp = function(index) {

    if (binaryTree[index].length - 1 == 1) { return };

    var tri = binaryTree[index][0];
    var lastTri = binaryTree[index].pop();

    lastTri[3] = 0;
    binaryTree[index][0] = lastTri;

    heapify_down(index, 0);

    return tri;
  }

  binaryTree.calcArea = function(entry) {

    var ax = entry[0][0];
    var ay = entry[0][1];

    var a = entry[2][0] - ax;
    var b = entry[1][0] - ax;
    var c = entry[2][1] - ay;
    var d = entry[1][1] - ay;

    return area = 0.5 * Math.abs(a * d - b * c);
  }

  function heapify_down(index, entry) {

    var min = entry;

    var left  = 2 * entry + 1;
    var right = 2 * entry + 2;

    if (left < binaryTree[index].length && binaryTree[index][left][1][2] < binaryTree[index][min][1][2]) { min = left; }
    if (right < binaryTree[index].length && binaryTree[index][right][1][2] < binaryTree[index][min][1][2]) { min = right; }

    if (entry != min) {

      binaryTree[index][entry][3] = min;
      binaryTree[index][min][3] = entry;

      swap(index, entry, min);
      heapify_down(index, min);
  }}


  function heapify_up(index, entry) {

    var min = entry;
    var parent = Math.floor(entry / 2);

    if (parent >= 0 && binaryTree[index][entry][1][2] < binaryTree[index][parent][1][2]) { min = parent; }

    if (entry != min) {

      binaryTree[index][entry][3] = min;
      binaryTree[index][min][3] = entry;

      swap(index, entry, min);
      heapify_up(index, min);
  }}


  function swap(index, a, b) {

    var temp = binaryTree[index][a];
    binaryTree[index][a] = binaryTree[index][b];
    binaryTree[index][b] = temp;
  }

  binaryTree.print = function(index) {

    for (var entry = 0; entry < binaryTree[index].length; entry += 1) {
      console.log("binaryTree: " + binaryTree[index][entry][0] + " : " + binaryTree[index][entry][1] + " : " + binaryTree[index][entry][2] + " : " + binaryTree[index][entry][3]);
    }
    console.log("----");
  }

  linkedList.print = function(index) {

    for (var entry = 0; entry < linkedList[index].length; entry += 1) {
      console.log("linkedList: " + linkedList[index][entry][0] + " : " + linkedList[index][entry][1] + " : " + linkedList[index][entry][2] + " : " + linkedList[index][entry][3]);
    }
    console.log("----");
  }

  binaryTree.specificPrint = function(entry) { console.log("entry: " + entry[0] + " : " + entry[1] + " : " + entry[2] + " : " + entry[3]); }

  return binaryTree;
}

