function reverseNormalizeArray(arr) 
{ 
  var slope = slopePoly(arr);

  for (var i  = 0; i < arr.length; i += 1) { 
    for (var j = 0; j < arr[i].tris.length; j += 1)  { 
      reverseNormalizePolyFormula(arr[i].tris[j], slope); 
  }}
}

function slopePoly(arr)
{
  //console.log(arr[0].tris[0]);

  //Setting initial values
  var maxX = arr[0].tris[0][0]; var minX = arr[0].tris[0][0]; var minY = arr[0].tris[0][1]; var maxY = arr[0].tris[0][1];

  for (var j = 0; j < arr.length; j += 1) {
    for (var i = 0; i < arr[j].tris.length; i += 1) {
      if (minX > arr[j].tris[i][0]) { minX = arr[j].tris[i][0]; }
      if (maxX < arr[j].tris[i][0]) { maxX = arr[j].tris[i][0]; }
      
      if (minY > arr[j].tris[i][1]) { minY = arr[j].tris[i][1]; }
      if (maxY < arr[j].tris[i][1]) { maxY = arr[j].tris[i][1]; }
  }}

  var dx = 4 / (maxX - minX);
  var dy = 2 / (maxY - minY);

  var slope = [dx, minX, minY, dy];

  console.log(slope);

  return slope;
}

function reverseNormalizePolyFormula(p, slope)
{
  p[0] = p[0] - (slope[1]);
  p[1] = p[1] - slope[2];

  p[0] = slope[0] * p[0] - 2;
  p[1] = ((slope[3]) * p[1] - 1);

  var degreeX = (p[0] * 90) / 180 * Math.PI;
  var degreeY = (p[1] * 90) / 180 * Math.PI;

  p[0] = Math.cos(degreeY) * Math.cos(degreeX);
  p[1] = Math.cos(degreeY) * Math.sin(degreeX);
  p[2] = Math.sin(degreeY);
}


