objArray.rotate = function(dx, dy, dz) {

  angleX += (dx / 180 * Math.PI);
  angleY += (dy / 180 * Math.PI);
  angleZ += (dz / 180 * Math.PI);

  cosa = Math.cos(angleZ);
  sina = Math.sin(angleZ);

  cosb = Math.cos(angleY);
  sinb = Math.sin(angleY);

  cosc = Math.cos(angleX);
  sinc = Math.sin(angleX);

  Axx = cosa * cosb;
  Axy = cosa * sinb * sinc - sina * cosc;
  Axz = cosa * sinb * cosc + sina * sinc;

  Ayx = sina * cosb;
  Ayy = sina * sinb * sinc + cosa * cosc;
  Ayz = sina * sinb * cosc - cosa * sinc;

  Azx = -sinb;
  Azy = cosb * sinc;
  Azz = cosb * cosc;

  this.forEach(function(polygon) {

    polygon.translate.length = 0;

    for (var i = 0; i < polygon.tris.length; i += 1)
    {
      var newpoint = [0,0,0];

      var pz = polygon.tris[i][2];
      var px = polygon.tris[i][0];
      var py = polygon.tris[i][1];

      newpoint[2] = Azx * px + Azy * py + Azz * pz;
      if (newpoint[2] > transparency) continue;

      newpoint[0] = Axx * px + Axy * py + Axz * pz;
      newpoint[1] = Ayx * px + Ayy * py + Ayz * pz;

      polygon.translate.push(newpoint);
    }

  });
}

objArray.normalize = function()
{
  this.forEach(function(polygon) { 
    polygon.translate.forEach(function(p) {
      
      p[0] = Math.floor(halfCanvas * (p[0] + 1));
      p[1] = Math.floor(halfCanvas * (p[1] + 1)); 

  })}); 
}

objArray.draw = function() {
  
  draw.beginPath();

  this.forEach(function(polygon) {

    if (polygon.translate.length == 0) return;
    draw.moveTo(polygon.translate[0][0], polygon.translate[0][1]);

    polygon.translate.forEach(function(point) { draw.lineTo(point[0], point[1]); })

  });

  draw.stroke();
  draw.closePath();
}

objArray.erase = function() {
  draw.clearRect(0,0, canvas.width, canvas.height);
  draw.beginPath();
  draw.arc(halfCanvas, halfCanvas, halfCanvas, 0, twoPI);
  draw.stroke();
  draw.closePath();
}



